import './App.css'
import axios from 'axios'

const App = () => {
  useEffect(() => {
    console.log('effect')
    axios
      .get('http://localhost:3001/notes')
      .then(response => {
        console.log('promise fulfilled')
        setNotes(response.data)
      })
  }, [])

  const showNotes = notes.map(note=> {return(<><div key = {note.owner}>Owner: {note.owner} </div >
                                            <div key ={note.phone}>Phone: {note.phone}</div>
                                            <div key ={note.ownerEmail}>Email: {note.ownerEmail}</div>
                                            <div key ={note.serialNumber}>serialNumber: {note.serialNumber}</div>
                                            <div key ={note.snapshotTimestamp}>Last time: {note.snapshotTimestamp}</div>
                                            <div key ={note.closestDistance}>closestDistance: {note.closestDistance}</div></>)})


  const [notes, setNotes] = useState([
    { serialNumber:'', snapshotTimestamp:'', closestDistance: 0, owner: '', ownerEmail: '' , phone:''}
  ]) 
  return (
    <div>
      <h2>Phonebook</h2>
    <>{showNotes}</>
    </div>
  )
}
export default App
